aUR(a){return"Welcome to your home system! This is what you will use to control certain parts of your home.\n\nTo start off, we have announcements and birthdays. Announcements are nice-to-know things about the house, home system, or other things. Birthdays tell you everyone in the family (immediate or extended) who has a birthday that day, displayed in a single list on the home page.\n\nNow, we have the announce messages feature. This is not related to the announcements feature. This allows anyone in the house to announce a message to the house using Google Translate.\n\nNext up, we have the system controls. We have volume (which controls how loud you want announcements and music to be; there is a set limit"+(a==null?"":" of "+B.c.az(a)+"%")+'), brightness of the screen, light/dark mode, and screen. Use the sliders in the volume/brightness section to change the volume and brightness. The volume icon also toggles as a mute/unmute button. Tap it to mute the volume (set it to 0), or unmute the volume (set it to whatever it was before). You can toggle the app between light and dark mode using the light/dark mode buttons. You can also turn the screen on or off using the screen on/off buttons. Turning the screen on typically takes a couple seconds for it to respond. You can also just move the mouse or use the keyboard on the host to wake it back up. While the screen is off, you can still use the home web app and even do stuff like announce messages or play music.\n\nNext up, we have night mode. When on, the dashboard is removed and the screen goes into a darkened state. You can still use the services on other devices. To exit night mode, click anywhere on the screen.\n\nYou can also cast music to the device. If you open Spotify and play music, you can open the Cast page and select "Home Server". (You might see "DEBUG: Home Server"; just ignore that.) Then, using the host or using the web app, you can play/pause the music, go next or back, or disconnect everybody from the server. (The last one might be helpful.)\n\nNext up, we have Dexcom readings. Click into this to see a graph and the current reading (with the previous reading being the smaller number). Up in the top right, you will see a refresh and a share button. Click the share button to display the Dexcom readings on the host, and click the newly-shown stop button to go back to the dashboard. Click the refresh button to refresh both the web app\'s and the host\'s monitor.\n\nWe also have a fireplace feature. Click into this to get a list of options, along with a button in the top right that controls the fireplace sound effects. This button displays the current state (on, off) of the fireplace sound effects. Tap one of the fireplace options to display the corresponding fireplace in fullscreen on the host. Click Off to bring the host back to the dashboard. To exit a fireplace on the host, click anywhere on the screen.\n\nEvery once in a while, you may see "Blank Severity Warning" banners at the top. These are displayed whenever there is a potentially dangerous issue, such as high host temperatures. Typically these will also be sent out in an email if the alert is potentially dangerous.\n\nThe Internet Test page is a tool to check your Internet. It first checks if the router is successfully running, then it gets details about the network and runs a speed test. It then presents all of the relevant details to you.\n\nWhen you first click into the page, there will be a large play button in the center of the screen. Tap this to start the test. You will see real-time updates as the test goes on. After it completes, it will show a big checkbark button. Click this to see the results.\n\nNotes: If there was an error, it will show \u201cFailed\u201d on the screen. If trying again a couple more times does not solve this, then report the incident. If there is no \u201cSpeed Test\u201d section in the results, then that means the speed test was unsuccessful and failed somewhere. This happens often; however, the server will retry one time if the speed test fails. If it failed both times, it will not show any results.\n\nIn the Settings menu, we have a few more options. In General, there is Colored Graphs. Click this to toggle this on/off (default is on). If this is on, graphs like in the Dexcom monitor will have colored points and axis labels. We can see the version of the current web app in About, and if we click Host Info, we can see the server version, system version, configuration version, and host app version of the host. The last setting in this category is Show Help Dialogue, which shows this dialogue again if you ever need it. In Device, we have three options: Refresh, Temperatures, and Power Off. First off, Refresh will simply send a request to the host to refresh announcements and contacts. These are not updated automatically on the host when I update them, but they do update every hour. This is typically unnecessary.\n\nIf we click Temperatures, we can see a very large amount of data concerning temperatures of every single sensor of the host. In General Temps, you will see every sensor (with its adapter) ranked top to bottom from most hot to least hot. Every section below General Temps is a specific adapter, each with a list of sensors. There are both temperature sensors and fan sensors. Fan sensors have an input and a minimum. The input is the current speed, and the minimum is the lowest they can go. Temperature sensors either just have an input (which is in Celsius), or they have an input, a max temperature, a critical temperature (which is the temperature that the system says is way too high), and the "crit_alarm" (which is 0 if the critical limit has not been hit, 1 if it has).\n\nIf we click Power Off, then we will get a confirmation, and if we click yes, then the system will be scheduled to shut down very soon. If the host\'s kiosk app is running, then there will be a "Cancel" option. If not, then run "pkill sleep" in a terminal to cancel shutdown.\n\nThe last setting is "Reset All Settings and Data" under "Settings & Data". This resets the current web app\'s (not the host\'s app\'s) settings.\n\nAnd there you have it! You are now ready to use your home system. I hope you enjoy, and please report any issues or concerns you see.'},
